"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Physical hives (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H19261310\">",
"      <span class=\"h1\">",
"       What are physical hives?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Hives are raised, red patches of skin that are usually very itchy (",
"      <a class=\"graphic graphic_picture graphicRef79242 \" href=\"mobipreview.htm?7/41/7824\">",
"       picture 1",
"      </a>",
"      ). Physical hives are hives that form in response to some sort of physical stimulation, such as heat, cold, or pressure. The medical term for hives is &ldquo;urticaria.&rdquo;",
"     </p>",
"     <p>",
"      The most common causes of physical hives include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Scraping or stroking &ndash;",
"        </strong>",
"        People who get this type of hives develop red, raised lines on their skin along areas that have been scraped or stroked (",
"        <a class=\"graphic graphic_picture graphicRef87054 \" href=\"mobipreview.htm?0/54/865\">",
"         picture 2",
"        </a>",
"        ). If you get this type of hives, your skin might get a hive pattern that matches your fingernails after you scratch an itch.",
"       </li>",
"       <li>",
"        <strong>",
"         Cold",
"        </strong>",
"        &ndash; People who are sensitive to cold get hives when their skin starts to warm up again after being cold.",
"       </li>",
"       <li>",
"        <strong>",
"         Increased body temperature or sweating",
"        </strong>",
"        &ndash; People who are sensitive to heat or sweat get lots of tiny hives on parts of the skin that have turned red.",
"       </li>",
"       <li>",
"        <strong>",
"         Vibration",
"        </strong>",
"        &ndash; People who are sensitive to vibration get hives on parts of their body that have been touching anything that vibrates. If you get this type of hives, you might get them on your palms after you have been driving and holding onto a steering wheel.",
"       </li>",
"       <li>",
"        <strong>",
"         Pressure",
"        </strong>",
"        &ndash; People who are sensitive to pressure can get hives anywhere on their body that has been pressed on. If you get this type of hives, you might get them on your palms after carrying something heavy. You might also get them on your feet after walking a long way. Because the skin on the palms and soles is thick, these areas might look red and swollen but not look like they have hives.",
"       </li>",
"       <li>",
"        <strong>",
"         Exercise",
"        </strong>",
"        &ndash; Hives that show up during exercise can be a sign of a dangerous problem called exercise-induced anaphylaxis.",
"       </li>",
"       <li>",
"        <strong>",
"         Sunlight or water",
"        </strong>",
"        &ndash; Hives caused by sunlight or water are rare.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Physical hives tend to last a long time or go away and come back. They are considered a type of chronic (or long-lasting) hives.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H19261365\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See a doctor or nurse if you aren&rsquo;t sure what is causing your hives or you aren&rsquo;t sure how to avoid the thing that triggers them.",
"     </p>",
"     <p>",
"      You should also see a doctor if you have ever had symptoms of a dangerous allergic reaction called &ldquo;anaphylaxis.&rdquo; Symptoms of anaphylaxis include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Trouble breathing, sounding hoarse, wheezing (hearing a whistling sound when you breathe)",
"       </li>",
"       <li>",
"        Swelling, especially around the face, eyelids, ears, mouth, hands, or feet",
"       </li>",
"       <li>",
"        Belly cramps, nausea, vomiting, or diarrhea",
"       </li>",
"       <li>",
"        Feeling dizzy or passing out",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Anaphylaxis can happen with certain kinds of physical hives. For example, if you have cold-induced hives, you could go into anaphylaxis if you go swimming in very cold water. Another example is exercise-induced anaphylaxis. If you have exercise-induced hives, it is important to stop and rest immediately if you develop hives. Continuing to exercise can be very dangerous.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H19261380\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Maybe. Your doctor or nurse will probably try to recreate the conditions that give you hives. For example, if you normally get hives in places where you are scratched, the doctor or nurse might gently scratch you. That way, he or she can study your skin&rsquo;s response.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H19261397\">",
"      <span class=\"h1\">",
"       How are physical hives treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The most important part of treatment is to try to avoid whatever triggers the hives. There are also medicines called antihistamines that can reduce the itching and swelling caused by hives. Some examples of these medicines include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        <a class=\"drug drug_patient\" href=\"mobipreview.htm?27/28/28100?source=see_link\">",
"         Cetirizine",
"        </a>",
"        (brand name: ZyrTEC)",
"       </li>",
"       <li>",
"        <a class=\"drug drug_patient\" href=\"mobipreview.htm?34/7/34932?source=see_link\">",
"         Loratadine",
"        </a>",
"        (sample brand names: Alavert, Claritin)",
"       </li>",
"       <li>",
"        <a class=\"drug drug_patient\" href=\"mobipreview.htm?37/43/38580?source=see_link\">",
"         Fexofenadine",
"        </a>",
"        (brand name: Allegra)",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      People who do not improve enough with antihistamines can get other medicines, including medicines called steroids, to reduce swelling and itching. These steroids are not the same steroids athletes take to build up muscle.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H19261412\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?18/17/18706?source=see_link\">",
"       Patient information: Chronic hives (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?36/47/37617?source=see_link\">",
"       Patient information: Hives (The Basics)",
"      </a>",
"      <br/>",
