"       Patient information: Anaphylaxis (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"mobipreview.htm?2/45/2772?source=see_link\">",
"       Patient information: Hives (urticaria) (Beyond the Basics)",
"      </a>",
"     </p>",
