var title_f43_27_44474="Tompkins metroplasty AB";
var content_f43_27_44474=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F67827%7EOBGYN%2F79101%7EOBGYN%2F58593&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F67827%7EOBGYN%2F79101%7EOBGYN%2F58593&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 490px\">",
"   <div class=\"ttl\">",
"    Tompkins metroplasty (A and B)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 470px; height: 615px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) In the Tompkins procedure, the septum is incised, but not removed. An initial incision is made down the middle of the septum until the common cavity is reached. (B) The septal tissue is incised bilaterally to unroof the two cavities.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Tompkins metroplasty (C and D)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 624px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (C) Repair then proceeds as in the Jones technique, with the anterior and the posterior aspects being approximated with continuous or interrupted sutures. (D) The deep myometrium is repaired.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Tompkins metroplasty (E)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 450px; height: 357px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (E) After which the superficial myometrium and serosa are closed with an imbricating suture.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
