var title_f43_27_44475="Return to play protocol";
var content_f43_27_44475=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F61318&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F61318&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Graduated return to play protocol",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Rehabilitation stage",
"      </td>",
"      <td class=\"subtitle1\">",
"       Functional exercise at each stage of rehabilitation",
"      </td>",
"      <td class=\"subtitle1\">",
"       Objective of each stage",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1. No activity",
"      </td>",
"      <td>",
"       Complete physical and cognitive rest",
"      </td>",
"      <td>",
"       Recovery",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2. Light aerobic exercise",
"      </td>",
"      <td>",
"       Walking, swimming or stationary cycling keeping intensity &lt;70 percent MPHR; no resistance training",
"      </td>",
"      <td>",
"       Increase HR",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       3. Sport-specific exercise",
"      </td>",
"      <td>",
"       Skating drills in ice hockey, running drills in soccer; no head impact activities",
"      </td>",
"      <td>",
"       Add movement",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       4. Non-contact training drills",
"      </td>",
"      <td>",
"       Progression to more complex training drills, eg, passing drills in football and ice hockey; may start progressive resistance training",
"      </td>",
"      <td>",
"       Exercise, coordination, and cognitive load",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       5. Full contact practice",
"      </td>",
"      <td>",
"       Following medical clearance, participate in normal training activities",
"      </td>",
"      <td>",
"       Restore confidence and assess functional skills by coaching staff",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       6. Return to play",
"      </td>",
"      <td>",
"       Normal game play",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Six-day return to play protocol. Each day the athlete makes a stepwise increase in functional activity, is evaluated for symptoms, and is allowed to progress to the next stage each successive day if asymptomatic.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: McCrory P, Meeuwisse W, Johnston K, et al. Consensus Statement on Concussion in Sport 3rd International Conference on Concussion in Sport Held in Zurich, November 2008. Clin J Sport Med 2009; 19:185. Copyright &copy; 2009 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
