var title_f43_27_44476="Criteria diagnosis ARVD";
var content_f43_27_44476=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F54842&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F54842&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Criteria for the diagnosis of arrhythmogenic right ventricular dysplasia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Family history",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Major",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Familial disease confirmed at necropsy or surgery",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Minor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Family history of premature sudden death (&lt;35 years) caused by suspected ARVD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Family history (clinical diagnosis based on present criteria)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        ECG depolarization/conduction abnormalities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Major",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Epsilon waves or localized prolongation (&gt;110 ms) of the QRS complex in the right precordial leads (V1 to V3)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Minor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Late potentials seen on signal averaged ECG",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Repolarization abnormalities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Minor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Inverted T waves in right precordial leads (V2 and V3) in people &gt;12 years and in the absence of right bundle branch block",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Tissue characterisation of walls",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Major",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Fibrofatty replacement of myocardium on endomyocardial biopsy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Global and/or regional dysfunction and structural alterations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        (detected by echocardiography, angiography, magnetic resonance imaging, or radionuclide scintigraphy)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Major",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Severe dilatation and reduction of right ventricular ejection fraction with no (or only mild) left ventricular impairment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Localized right ventricular aneurysms (akinetic or dyskinetic areas with diastolic bulging)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Severe segmental dilatation of the right ventricle",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Minor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Mild global right ventricular dilatation and/or ejection fraction reduction with normal left ventricle",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Mild segmental dilatation of the right ventricle",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Regional right ventricular hypokinesia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Arrhythmias",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Minor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Left bundle branch block type ventricular",
"tachycardia (sustained or nonsustained) documented on ECG, Holter",
"monitoring or during exercise testing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Frequent ventricular extrasystoles (more than 1000/24 h) on Holter monitoring",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: McKenna WJ, Thiene G, Nava A, et al. Br Heart J 1994; 71:215.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
