" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Spinous process fractures: Clay shoveler's fracture",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 288px; height: 402px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The clay shoveler's fracture is an isolated fracture of one of the spinous processes of the lower cervical vertebrae. It is a stable injury that most often occurs with direct trauma to the spinous process.",
